	public int calcScore(String _str) {
        int count = 0;
        for (int i = 1; i < _str.length(); i++) {
            if (_str.charAt(i) == _str.charAt(i - 1)) {
            	count++;
            } 
        }
		return count;
	}
	
	public List<ScoredPath> encodeHeuristics(String _str, Map<Character, Map<Character, Set<String>>> _hashmap, char _ch_prev) {
		final int K = 50;
		
		List<ScoredPath> currentPaths = new ArrayList<>();
	    currentPaths.add(new ScoredPath("", 0));
		
		
		for (char _ch_next : _str.toCharArray()) {
			
			PriorityQueue<ScoredPath> queue = new PriorityQueue<>(Comparator.comparingInt(ScoredPath::getScore));
			
			for (ScoredPath scoredPath : currentPaths) {
				Set<String> steps = _hashmap.get(_ch_prev).get(_ch_next);
				
				for (String step : steps) {
					String _append = step.equals(String.valueOf(_ACK))?step:step+_ACK;
					String _new_str = scoredPath.value+_append; 
					ScoredPath s = new ScoredPath(_new_str, calcScore(_new_str));
					s.memo.putAll(scoredPath.memo);
					s.memo.put(String.valueOf(_ch_prev)+_ch_next, step+_append);
					
					queue.add(s);
					if(queue.size() > K) {
						queue.poll();
						
					}
				}
			}
			_ch_prev = _ch_next;
			currentPaths = new ArrayList<>(queue);
		}
		return currentPaths;
	}


	
	public Set<String> encode(String _str, Map<Character,Map<Character,Set<String>>> _hashmap, char _ch_prev){
		Set<String> result = new HashSet<>();
	    
	    for (char _ch_next : _str.toCharArray()) {
	        // Get the set of paths from _ch_prev to _ch_next
	        Set<String> currentPaths = _hashmap.get(_ch_prev).get(_ch_next);
	        Set<String> newResult = new HashSet<>();
	        
	        if (result.isEmpty()) {
	            // Initialize result with the first step's paths
	            newResult.addAll(currentPaths);
	        } else {
	            // Combine existing paths in result with current paths
	        	if(!currentPaths.isEmpty()) {
	        		for (String existingPath : result) {
	            	
	            		for (String newPath : currentPaths) {
		                    String combinedPath = existingPath;
		                    combinedPath+=newPath;
		                    newResult.add(combinedPath);
		                }
	        		}
	        	} else {
            		newResult = result;
            	}
	        }
	        Set<String> newResultWitA = new HashSet<>();
	        for (String _nl : newResult) {
        		newResultWitA.add(_nl.endsWith(_ACK+"")?_nl:_nl+_ACK);
//	        	logln("parts:"+newResultWitA);
			}
	        
	        // Update result for the next iteration
	        result = newResultWitA;
	        _ch_prev = _ch_next;
	    }
	    
		return result;
	}
	
	public Set<ScoredPath> encode_possible_strings(Set<ScoredPath> _to_be_encoded_strs, final Map<Character,Map<Character,Set<String>>> _hashmap, char _ch_prev, String _lvl){
		Set<ScoredPath> encoded_strs = new HashSet<ScoredPath>();
		for (ScoredPath _string : _to_be_encoded_strs) {
			List<ScoredPath> chs = encodeHeuristics(_string.value,_hashmap,_ch_prev); //310188 with heuristics and without
			encoded_strs.addAll(chs);
		}
		return encoded_strs;
	}
	
	private String decode(String _chars, Place[][] map, char _start) {
		Place start_p = null;
		for (int j = 0; j < map.length; j++) {
			for (int i = 0; i < map[j].length; i++) {
				if(map[j][i].ch==_start) {
					start_p = map[j][i];
					break;
				}
					 
			}
		}
		
		int newX = start_p.x;
		int newY = start_p.y;
		
		StringBuffer sb = new StringBuffer();
    	for (char c : _chars.toCharArray()) {
    		
    		int _dir=-2;
    		switch (c) {
				case '<':_dir=0; break;
				case 'v':_dir=1; break;
				case '>':_dir=2; break;
				case '^':_dir=3; break;
				case _ACK:_dir=-1; break;
			}
			if(_dir != -1) {
				newX += dx[_dir];
				newY += dy[_dir];
			} else {
				sb.append(map[newY][newX].ch);
			}
		}
    	System.out.println(_chars+" dechipered: "+sb.toString());
    	return sb.toString();
    }

